import React,{useState} from 'react'

const arr = [
  {
    "1" : [
            `
            <div>
                <h1>sonam</h1>
                <h1>nagpur</h1>
            </div> 
        `]
  },
  {
    name: "vikash",
    city: "delhi",
  },
  {
    name: "bittu",
    city: "kolkata",
  },
];

export default function App() {
    const [data, setData] = useState(arr);
    
    return (
        <div>
            {
                arr.map(ele=>(
                    <div style={{border:"1px solid black"}}>
                        <h1>{ele.name}</h1>
                        <h1>{ele.city}</h1>
                    </div>
                )
                )
            }
        </div>
    )
}
